import Container from 'react-bootstrap/Container';
import Button from 'react-bootstrap/Button';
import React, { useEffect } from "react";

function Paginado (props){

    useEffect(() => props.anterior_state, [props.anterior_state])
    useEffect(() => props.siguiente_state, [props.siguiente_state])
return [
    <Container className='bg-light p-2' id="paginado_container">
    <Button id='anterior_tabla' variant={'outline-primary margin_left_085rem ' + (props.anterior_state ? '' : 'disabled')} onClick={props.goOnPrevPage}>Anterior</Button>
    <Button id='siguiente_tabla' variant={'outline-primary margin_left_085rem ' + (props.siguiente_state ? '' : 'disabled')} onClick={props.goOnNextPage}>Siguiente</Button>
</Container>
]
}
export default Paginado;
